import { Box, Grid, Pagination, Stack, Typography } from "@mui/material";
import React, { useEffect, useState } from "react";
import PostsCard from "./PostsCard";
import Tepsikebab from "../../static/tepsikebab.jpg";
import EggplantMoussaka from "../../static/patlıcanmusakka.jpg";
//import axios from 'axios'
const Posts = () => {

  return (
    <Box>
      <Typography variant="h4" align="center">
        {" "}
        Latest Recipes{" "}
      </Typography>
      <Grid
        container
        columnSpacing={{ xs: 0, sm: 1, md: 1 }}
        direction={"column"}
      >
          <Grid item xs>
          <PostsCard title="Tepsi Kebab" excerpt="Tray kebab, also known as lahm-ı sini, is just one of the delicious dishes from Antakya. Although it looks like a giant vegetable meatball on the tray, it is actually a special kebab in every way." image={Tepsikebab} blogHref="/details/1" myDirection="flex" />
        </Grid>
      </Grid>
      <Typography
        variant="h4"
        bgcolor={"black"}
        color="white"
        align="center"
        mt={4}
        mb={4}
      >
        Most Popular
      </Typography>
      <Grid container columnSpacing={{ xs: 0, sm: 1, md: 1 }} direction={{md:'row'}}>
      <Grid item md={6} xs={12} sm={6}>
          <PostsCard title="Palican Musakka" excerpt="sdfsd" image={EggplantMoussaka} myDirection={"block"} />
        </Grid>
      </Grid>
      <Stack
        spacing={2}
        mt={3}
        mb={3}
        justifyContent="center"
        alignItems={"center"}
      >

      </Stack>
    </Box>
  );
};

export default Posts;
